package com.mzbr.videoeditingservice.model;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import lombok.AllArgsConstructor;import lombok.Builder;import lombok.Getter;import lombok.NoArgsConstructor;@Getter@Entity@NoArgsConstructor@AllArgsConstructor@Builderpublic class ServerAudioEntity {	@Id	@GeneratedValue(strategy = GenerationType.IDENTITY)	Long id;	String url;}